import React from "react";
import "../css/home.css";

const Home = () => {
  return (
    <div id="homeHeaderContainer">
      <header>
        <video autoPlay loop muted playsInline width="100" height="100">
          <source src="../iconsAnimate/bifurquer.mp4" />
          Votre navigateur ne prend pas en charge la balise vid√©o
        </video>
        <h1 id="homeTitle">La maison jungle</h1>
      </header>
    </div>
  );
};

export default Home;
